    false,nt"url": null,nt"notes": "BPI Structures are derived from a focal
    mean analysis on bathymetry and slope. The bathymetry grid (5 m cell size) is derived
    from bathymetry from three sources: Multibeam bathymetry collected by Coral Reef
    Ecosystem Division aboard NOAA R/V AHI, and NOAA Ship Hi'ialakai; Multibeam bathymetry
    collected aboard the US Naval Ship Sumner, and lidar, both collected by Naval Oceanographic
    Office; and bathymetry derived from multispectral IKONOS satellite imagery. BPI
    Structures was created using the Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/).
    Cell values represent one of 13 classes in an index of seafloor terrains.This data
    set is for Tinian and Aguijan Islands, and Tatsumi Bank, Commonwealth of the Northern
